// CHALLENGE: uncomment the code below and see the car stats rendered
import React from "react";
import ReactDOM from "react-dom";
import cars from "./practice";

const [honda,tesla]=cars;

const hondaTopSpeed=honda.speedStats.topSpeed;
const teslaTopSpeed=tesla.speedStats.topSpeed;

// const hondacolours=honda.coloursByPopularity;
const teslacolours=tesla.coloursByPopularity;

const [teslaTopColour]=[teslacolours];

console.log();

ReactDOM.render(
  <table>
    <tr>
      <th>Brand</th>
      <th>Top Speed</th>
      <th>Top Colour</th>
    </tr>
    <tr>
      <td>{tesla.model}</td>
      <td>{teslaTopSpeed}</td>
      <td>{teslaTopColour}</td>
    </tr>
    <tr>
      <td>{honda.model}</td>
      <td>{hondaTopSpeed}</td>
      <td>{hondaTopColour}</td>
    </tr>
  </table>,
  document.getElementById("root")
);
